import React, { memo } from 'react'
import { RecommendWrapper } from './style'
import ThemeHeader from '@/components/theme-header-rcm'
import {} from 're'
export default memo(function index() {
    return (
        <RecommendWrapper>
            <ThemeHeader title="热门推荐" keyword={['华语','流行','民谣','摇滚','电子']} />
        </RecommendWrapper>
    )
});
